import { Signer } from "ethers";
import { Provider, TransactionRequest } from "@ethersproject/providers";
import { Contract, ContractFactory } from "@ethersproject/contracts";
import { ExpiringMultiPartyLibLibraryInterface } from "./ExpiringMultiPartyLibLibraryInterface";

export class ExpiringMultiPartyLibFactoryLibrary extends ContractFactory {
  constructor(signer?: Signer) {
    super(_abi, _bytecode, signer);
  }

  deploy(): Promise<Contract> {
    return super.deploy() as Promise<Contract>;
  }

  getDeployTransaction(): TransactionRequest {
    return super.getDeployTransaction();
  }

  async deployLibrary(): Promise<ExpiringMultiPartyLibLibraryInterface> {
    const contract = await super.deploy();
    return {
      ExpiringMultiPartyLib: contract.address,
    };
  }
}

const _bytecode =
  "";

const _abi = [];
